import React, { Component } from 'react';
import {
  Navbar,
  Nav, Button, NavItem } from 'react-bootstrap';
  import { Spring } from  'react-spring/renderprops';
  import Slider from "react-slick";
import sliderImg from './homeimg/1.png';
import sliderImg2 from './homeimg/2.png';
import sliderImg3 from './homeimg/3.png';
import sliderImg4 from './homeimg/4.png';
import sliderImg5 from './homeimg/5.png';
import sliderImg6 from './homeimg/6.png';
import backImg from './backgroundimg/01.jpg';
// Add CDN to HTML For Slider
//<link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
/* <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" /> */
class App extends Component {

  render() {
    //js
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };

  // Styles
  const logoHead = {
    padding:'15px 10px 20px 20px',
    color:'black'
  }
  const logoWord = {
    fontSize:'40px',
    marginLeft:'50px',
    color:'white'
  }

  const body = {
    backgroundImage: `url(${backImg})`,
    backgroundRepeat: 'no-repeat',
    backgroundSize: '1700px auto'
  }

const imgDem = {
  width:'100%',
  height:'500px'
}
const buttonStyle = {
  textAlign:'center'
}

    return (
<div style={body}>

<Spring
from={{ opacity: 0, marginLeft:-500}}
to={{opacity: 1, marginLeft:0 }}
config={{ delay: 100, duration:1000 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}
<div className="container">
<div className="row">
<div className="col-lg-12">
<div style={logoHead}>
    <h3 style={logoWord}>Logo Here</h3>
</div>
</div>
</div>
</div>

  </div>
) }

</Spring>




<Spring
from={{ opacity: 0, marginTop:-500}}
to={{opacity: 1, marginTop:0 }}
config={{ delay: 100, duration:1000 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}
<Navbar inverse fluid >

<Navbar.Header>
  <Navbar.Brand>
    <a href="#">Brand</a>
  </Navbar.Brand>
  <Navbar.Toggle />
</Navbar.Header>

<Navbar.Collapse>
  <Nav pullRight>
    <NavItem eventKey={1} href="#">Hello</NavItem>
    <NavItem eventKey={2} href="#">World</NavItem>
  </Nav>
</Navbar.Collapse>

</Navbar>




  </div>
) }

</Spring>


<br/>


<Spring
from={{ opacity: 0}}
to={{opacity: 1}}
config={{ delay: 2100, duration:2100 }}

>

{ props => (
  <div style={props}>
{/* Insert below */}

<Slider {...settings}>
        <div>
          <img src={sliderImg} style={imgDem} />
          <div style={buttonStyle}>
             <Button variant="warning">Warning</Button>
          </div>

        </div>
        <div>

          <img src={sliderImg2} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg3} style={imgDem}/>
        </div>
        <div>

          <img src={sliderImg4} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg5} style={imgDem} />
        </div>
        <div>

          <img src={sliderImg6} style={imgDem} />
        </div>
      </Slider>







  </div>
) }

</Spring>

<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
<br/>
